DROP TABLE IF EXISTS AspNetRoleClaims;
CREATE TABLE "AspNetRoleClaims" ( "Id" INTEGER NOT NULL CONSTRAINT "PK_AspNetRoleClaims" PRIMARY KEY, "ClaimType" TEXT NULL, "ClaimValue" TEXT NULL, "RoleId" TEXT NOT NULL, CONSTRAINT "FK_AspNetRoleClaims_AspNetRoles_RoleId" FOREIGN KEY ("RoleId") REFERENCES "AspNetRoles" ("Id") ON DELETE CASCADE );
DROP TABLE IF EXISTS AspNetRoles;
CREATE TABLE "AspNetRoles" ( "Id" TEXT NOT NULL CONSTRAINT "PK_AspNetRoles" PRIMARY KEY, "ConcurrencyStamp" TEXT NULL, "Name" TEXT NULL, "NormalizedName" TEXT NULL );
DROP TABLE IF EXISTS AspNetUserClaims;
CREATE TABLE "AspNetUserClaims" ( "Id" INTEGER NOT NULL CONSTRAINT "PK_AspNetUserClaims" PRIMARY KEY, "ClaimType" TEXT NULL, "ClaimValue" TEXT NULL, "UserId" TEXT NOT NULL, CONSTRAINT "FK_AspNetUserClaims_AspNetUsers_UserId" FOREIGN KEY ("UserId") REFERENCES "AspNetUsers" ("Id") ON DELETE CASCADE );
DROP TABLE IF EXISTS AspNetUserLogins;
CREATE TABLE "AspNetUserLogins" ( "LoginProvider" TEXT NOT NULL, "ProviderKey" TEXT NOT NULL, "ProviderDisplayName" TEXT NULL, "UserId" TEXT NOT NULL, CONSTRAINT "PK_AspNetUserLogins" PRIMARY KEY ("LoginProvider", "ProviderKey"), CONSTRAINT "FK_AspNetUserLogins_AspNetUsers_UserId" FOREIGN KEY ("UserId") REFERENCES "AspNetUsers" ("Id") ON DELETE CASCADE );
DROP TABLE IF EXISTS AspNetUserRoles;
CREATE TABLE "AspNetUserRoles" ( "UserId" TEXT NOT NULL, "RoleId" TEXT NOT NULL, CONSTRAINT "PK_AspNetUserRoles" PRIMARY KEY ("UserId", "RoleId"), CONSTRAINT "FK_AspNetUserRoles_AspNetRoles_RoleId" FOREIGN KEY ("RoleId") REFERENCES "AspNetRoles" ("Id") ON DELETE CASCADE, CONSTRAINT "FK_AspNetUserRoles_AspNetUsers_UserId" FOREIGN KEY ("UserId") REFERENCES "AspNetUsers" ("Id") ON DELETE CASCADE );
DROP TABLE IF EXISTS AspNetUserTokens;
CREATE TABLE "AspNetUserTokens" ( "UserId" TEXT NOT NULL, "LoginProvider" TEXT NOT NULL, "Name" TEXT NOT NULL, "Value" TEXT NULL, CONSTRAINT "PK_AspNetUserTokens" PRIMARY KEY ("UserId", "LoginProvider", "Name") );
DROP TABLE IF EXISTS AspNetUsers;
CREATE TABLE "AspNetUsers" ( "Id" TEXT NOT NULL CONSTRAINT "PK_AspNetUsers" PRIMARY KEY, "AccessFailedCount" INTEGER NOT NULL, "ConcurrencyStamp" TEXT NULL, "Email" TEXT NULL, "EmailConfirmed" INTEGER NOT NULL, "LockoutEnabled" INTEGER NOT NULL, "LockoutEnd" TEXT NULL, "NormalizedEmail" TEXT NULL, "NormalizedUserName" TEXT NULL, "PasswordHash" TEXT NULL, "PhoneNumber" TEXT NULL, "PhoneNumberConfirmed" INTEGER NOT NULL, "SecurityStamp" TEXT NULL, "TwoFactorEnabled" INTEGER NOT NULL, "UserName" TEXT NULL );

DROP TABLE IF EXISTS Checkin;
CREATE TABLE "Checkin" ( `Username` TEXT NOT NULL, `CheckedinBy` TEXT NOT NULL, `Timestamp` TEXT );
DROP TABLE IF EXISTS Faq;
CREATE TABLE "Faq" ( `Id` INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, `Question` TEXT NOT NULL, `Answer` TEXT NOT NULL );
DROP TABLE IF EXISTS LeaderBoard;
CREATE TABLE `LeaderBoard` ( `Username` TEXT NOT NULL, `Score` INTEGER, `Rank` INTEGER, `LastUpdated` TEXT, PRIMARY KEY(`Username`) );
DROP TABLE IF EXISTS Resource;
CREATE TABLE "Resource" ( `Id` INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, `Title` TEXT NOT NULL, `Link` TEXT NOT NULL, `Description` TEXT, `ProviderName` TEXT );
DROP TABLE IF EXISTS Schedule;
CREATE TABLE "Schedule" ( `Id` INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT UNIQUE, `StartTime` TEXT NOT NULL, `EndTime` TEXT NOT NULL, `EventDescription` TEXT, `Room` TEXT NOT NULL, `EventTitle` TEXT NOT NULL, `Presenter` TEXT );
DROP TABLE IF EXISTS Video;
CREATE TABLE `Video` ( `Id` INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, `Title` TEXT, `Url` TEXT NOT NULL );









